import React from 'react';

const SideBar = () => {
  return (
    <div class="dropdown" data-toggle="dropdown">
      <img src="/images/SideBar.png" alt="" height="55px" width="50px" className="SideBar" />
      <div class="dropdown-content">
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
      </div>
    </div>
  );
};

export default SideBar;
